import profilePic from './logo192.png'
import './Event.css'; // Add styles in a separate CSS file
import React from "react";

function Event() {
  
  return (
    <div className="card-container">
      
      {imgSrc && imgAlt && (
        <img src={"https://picsum.photos/id/201/300/200"} alt={"Card Image 1"} className="card-img" />
      )}
      {title && <h1 className="card-title">{"Card Title"}</h1>}
      {description && <p className="card-description">{"This is the card description section. You can add more details about the product here"}</p>}
      {buttonText && link && (
        <a href={link} className="card-btn">
          {buttonText}
        </a>
      )}
    </div>
  );
}

export default Event;
